SAW The Videogame NTSC XBOX360 Title: Saw: The Videogame Developer: Konami Publisher: Zombie Platform: Xbox 360 Genre: Action Language: English Origin: NTSC/U Release Date: 10/2/2009 Store Date: 10/6/2009 Size: 73 x 100MB Link: http://xbox360.ign.com/objects/142/14231742.html The story centers on Detective David Tapp who awakens in a decrepit, abandoned asylum. He has been captured by his longtime nemesis, Jigsaw. Obsessed with catching this serial killer, Tapp%u2019s mission has consumed him and ruined his family, resulting in divorce, mental imbalance, and abandonment. Worse yet, this frantic hunt destroyed Tapp%u2019s career while he watched his long-time friend and partner get killed by one of Jigsaw-s traps. Now Jigsaw has the upper hand and has captured the detective. Tapp must play a deadly game%u2014the likes of which he has been investigating for years%u2014to escape, and in order to do so he must survive the lethal traps and puzzles that Jigsaw has put in place for him and others. But each victim has a dark connection to Tapp. Will Tapp save them? Can he survive his obsession to find the Jigsaw killer?
